import axios from "axios"
import { useEffect, useState } from "react"

const PokeCard = ({data}) => {

    const [currentPokemon, setCurrentPokemon] = useState()

    useEffect(() => {
        axios
            .get(data[0].url)
            .then(res => res.data)
            .then(pokemon => setCurrentPokemon(pokemon))
    }, [data]);

    return (
        <div>
            Hello {currentPokemon.name}!
        </div>
    )
} 

export default PokeCard
